export const url = {
    token: "http://localhost:8888/token",
    new_releases: "https://api.spotify.com/v1/browse/new-releases",
    search: "https://api.spotify.com/v1/search?q=",
};

export const urlHandler = {
    artist: "&type=artist",
    album: "&type=album",
    playlist: "&type=playlist",
    track: "&type=track",
};
